import React, { useState, useEffect } from 'react';
import RoomLayout from './components/RoomLayout';
import './App.css';

function App() {
  const [rooms, setRooms] = useState([]);
  const [switchStates, setSwitchStates] = useState({});

  // Generate random number of rooms (4-8) and create room layout
  useEffect(() => {
    generateNewLayout();
  }, []);

  const generateNewLayout = () => {
    const numRooms = Math.floor(Math.random() * 5) + 4; // 4-8 rooms
    const newRooms = [];
    const newSwitchStates = {};

    // Container dimensions
    const containerWidth = 800;
    const containerHeight = 600;

    // Generate creative floor plan with potential negative spaces
    const { rooms, lightAreas } = generateCreativeFloorPlan(numRooms, containerWidth, containerHeight);

    rooms.forEach((room, i) => {
      const roomId = String.fromCharCode(65 + i); // A, B, C, D, etc.
      newRooms.push({
        id: roomId,
        label: roomId,
        isActive: false,
        width: room.width,
        height: room.height,
        left: room.left,
        top: room.top,
        type: 'room'
      });
      newSwitchStates[roomId] = false;
    });

    // Add light areas for negative spaces
    lightAreas.forEach((area, i) => {
      const lightId = `L${i + 1}`;
      newRooms.push({
        id: lightId,
        label: lightId,
        isActive: false,
        width: area.width,
        height: area.height,
        left: area.left,
        top: area.top,
        type: 'light'
      });
      newSwitchStates[lightId] = false;
    });

    setRooms(newRooms);
    setSwitchStates(newSwitchStates);
  };

  // Function to generate irregular floor plan that fills space without overlaps
  const generateFloorPlan = (numRooms, containerWidth, containerHeight) => {
    const rooms = [];
    const margin = 2;

    // Create irregular room shapes using a more organic approach
    if (numRooms <= 4) {
      // Create 4 irregular rooms that fill the space
      const room1 = {
        width: Math.random() * 100 + 200, // 200-300px
        height: Math.random() * 100 + 200, // 200-300px
        left: margin,
        top: margin
      };

      const room2 = {
        width: containerWidth - room1.width - margin * 3,
        height: Math.random() * 100 + 150, // 150-250px
        left: room1.width + margin * 2,
        top: margin
      };

      const room3 = {
        width: Math.random() * 100 + 150, // 150-250px
        height: containerHeight - room1.height - margin * 3,
        left: margin,
        top: room1.height + margin * 2
      };

      const room4 = {
        width: containerWidth - room3.width - margin * 3,
        height: containerHeight - room2.height - margin * 3,
        left: room3.width + margin * 2,
        top: room2.height + margin * 2
      };

      rooms.push(room1, room2, room3, room4);

    } else if (numRooms <= 6) {
      // Create 6 irregular rooms
      const baseWidth = containerWidth / 3;
      const baseHeight = containerHeight / 2;

      for (let i = 0; i < numRooms; i++) {
        const row = Math.floor(i / 3);
        const col = i % 3;

        // Add variation to each room
        const widthVariation = (Math.random() - 0.5) * 60; // ±30px variation
        const heightVariation = (Math.random() - 0.5) * 40; // ±20px variation

        const width = Math.max(100, baseWidth + widthVariation);
        const height = Math.max(80, baseHeight + heightVariation);
        const left = col * baseWidth + margin;
        const top = row * baseHeight + margin;

        rooms.push({ width, height, left, top });
      }

    } else {
      // Create 8 irregular rooms
      const baseWidth = containerWidth / 4;
      const baseHeight = containerHeight / 2;

      for (let i = 0; i < numRooms; i++) {
        const row = Math.floor(i / 4);
        const col = i % 4;

        // Add variation to each room
        const widthVariation = (Math.random() - 0.5) * 40; // ±20px variation
        const heightVariation = (Math.random() - 0.5) * 30; // ±15px variation

        const width = Math.max(80, baseWidth + widthVariation);
        const height = Math.max(60, baseHeight + heightVariation);
        const left = col * baseWidth + margin;
        const top = row * baseHeight + margin;

        rooms.push({ width, height, left, top });
      }
    }

    // Ensure rooms don't exceed container bounds
    return rooms.map(room => ({
      ...room,
      width: Math.min(room.width, containerWidth - room.left - margin),
      height: Math.min(room.height, containerHeight - room.top - margin)
    }));
  };

  const toggleSwitch = (roomId) => {
    setSwitchStates(prev => ({
      ...prev,
      [roomId]: !prev[roomId]
    }));
  };

  return (
    <div className="app">
      <div className="app-header">
        <h1>Virtual Room Mock-up</h1>
        <button onClick={generateNewLayout} className="regenerate-btn">
          Generate New Layout
        </button>
      </div>

      <div className="app-content">
        <div className="layout-section">
          <h2>Floor Plan Layout</h2>
          <RoomLayout 
            rooms={rooms} 
            switchStates={switchStates}
            onToggleSwitch={toggleSwitch}
          />
        </div>
      </div>
    </div>
  );
}

export default App;
